=head1 ATTRIBUTES


=head2 B<REQUIRED> Action => Str

The action for the WAF web ACL customization. You can specify
C<override> to specify a separate WAF web ACL for the distribution
tenant. If you specify C<disable>, the distribution tenant won't have
WAF web ACL protections and won't inherit from the multi-tenant
distribution.


=head2 Arn => Str

The Amazon Resource Name (ARN) of the WAF web ACL.



